);
INSERT INTO `recordingcomment` VALUES (1,NULL,'Bob','Ok, I&#145;d better say a few words... When I received both this and the following one (Cambridge Boathouse) they were mixed up and named as Boston 1971 & 1973, but I think they were accidentally mis-labeled at some time. Why do I think this? Well, by doing a comparison of some tracks included in Precise Modern Lovers Order & also by checking out some other people&#145;s early Modern Lovers web pages: they tie in as actually being from Harvard University 1971 & Cambridge Boathouse.Quality-wise though, the recording sound is pretty rough, especially when you compare them to the cleaned up songs included on Precise Modern Lovers Order, but, because some are not included on either Precise Modern Lovers Order or Live at the Longbranch Saloon, then they are probably only available within this recording. So, that&#145;s my ten cents, enough said...','2011-04-09 00:00:00',1,0),(4,4,'Bob','Same story as the Harvard University...I think... However please let me know if you can help identify either of them better - thanks.','2011-04-09 00:00:00',1,0),(5,5,'Bob','Much of this recording is in a very poor state, and a number of the tracks are barely audible. The tape had a note attached  &#145;with Mo Tucker in audience&#145;.','2011-04-09 00:00:00',1,0),(6,6,'Bob','Ernie Brooks --  bass guitarAndy Paley    --  drums / vocalsJonathan Paley --  guitarJody Thaxter     --  backing vocalsMiranda Remington  --  backing vocals','2011-04-09 00:00:00',1,0),(7,7,'Bob','Jonathan Richman and a new line up of &#145;The Modern Lovers&#145; - including Ernie Brookes and Curly Keranen; and  maybe Andy Paley too.','2011-04-09 00:00:00',1,0),(8,8,'Bob','Jonathan with Leroy Radcliffe on guitar, Curly Keranen on bass, accompanied an unnamed drummer.The sound is a little &#145;boomy&#145;. ','2011-04-09 00:00:00',1,0),(9,9,'Bob','Jonathan and the Modern Lovers - Leroy Radcliffe, Curly Keranen, and D. Sharpe. A really rare recording, with a couple of completely unknown songs - &#145;At Home with a Lover&#145; and  &#145;I Love People&#145;&#145; - both of them don&#145;t seem to exist on any other JR recordings. Some issues with the sound, a bad burn&#145;s been done at some time in the past, but nothing too much to spoil it.','2011-04-09 00:00:00',1,0),(10,10,'Bob','This is such a fun recording! Jonathan taking the second line up of Modern Lovers on the road with his new songs; Ice Cream Man; Here come the Martian, Martians; Rockin&#145; Rockin&#145; Leprechauns; etc, to a New York audience that sound like they fully expected to hear the &#145;old stuff!&#145; Lots of heckling at the beginning but Jonathan soon has them won over (well most of them)Best heckle is something like &#145;You sound like you&#145;ve got a head full of Ice Cream!&#145;','2011-04-09 00:00:00',1,0),(11,11,'Bob','An unusual and rare recording; Jonathan and Greg (Curly Keranen?) performing for the staff of Government Center one lunch-time, someone has provided everyone with lyric sheets so they can join in the chorus, which they do after Jonathan has ran though the song once.(On the same CD as &#145;Boston Center for the Arts&#145; 1974)','2011-04-09 00:00:00',1,0),(12,12,'Bob','With Leroy Radcliffe, Curly Keranen, and D. Sharpe.','2011-04-09 00:00:00',1,0),(15,15,'Bob','From a radio broadcast recently made available on &#145;Night Train&#145;, VPRO Radio, Netherlands, a super sounding show, and with something almost unique too, &#145;Here we are in ancient Egypt&#145;, great stuff...','2011-04-09 00:00:00',1,0),(16,16,'Bob','With Asa, Leroy, and D. Sharpe. Including a 12 minute version of \"Roadrunner\"','2011-04-09 00:00:00',1,0),(17,17,'Bob','Exact date of this show unknown. But it seems to be pretty likely near the date of  the New York University show - from the 29th October - as both shows include &#145;Little Boy In My Heart&#145; along with a trombone instrumental.Another fun sounding two set show with the Modern Lovers, marred only by two of the songs were cut short on the taping.','2011-04-09 00:00:00',1,0),(18,18,'Bob','A great show this - with a very funny trombone instrumental and a few unusual songs, as well as, Little Boy In My Heart, a song that I&#145;m only aware of through this recording and one other - The Paradise, Boston (just above here) - with Leroy Radcliffe, Asa Brebner, and D. Sharpe.','2011-04-09 00:00:00',1,0),(22,22,'Bob','Jonathan with the Modern Lovers: Asa Brebner, Leroy Radcliffe and D. Sharpe. Ice Cream Man is great fun... with loads and loads of false endings.','2011-04-09 00:00:00',1,0),(23,23,'Bob','I received this a while back unnamed and undated, and previously had it listed as 1978 filler, Venue Unknown. However I&#145;ve now been given a lot more info about where it was recorded and also confirmation of the date. Apparently this was a free concert recorded by BRT , Belgium National TV, since then re-named  VRT, which was broadcast in three sections. VRT say that what we have here is just one of them,... so maybe someone out there has the others?','2011-04-09 00:00:00',1,0),(24,24,'Bob','Cover files available','2011-04-09 00:00:00',1,0),(25,25,'Bob','Jonathan with Leroy Radcliffe and Asa Brebner, both this and the show from the following night are really sharp recordings; neat that such early shows occasionally turn up in great condition.','2011-04-09 00:00:00',1,0),(27,27,'Bob','An early solo show with a few unusual song choices, and, tantalizingly, a few lines of an unknown and unrecorded song &#145;Nuclear Power&#145;, probably made up on the spot soon after Jonathan noticed someone wearing an anti-nuclear button....Ends with a barely audible acapella encore','2011-04-09 00:00:00',1,0),(28,28,'Bob','A pretty rare solo show, but not the best of recordings with this one. ','2011-04-09 00:00:00',1,0),(29,29,'Bob','A pretty good show!','2011-04-09 00:00:00',1,0),(30,30,'Bob','On the same CD as the one from the Roxy of the 5th October 1980. The whole of this show seems to be recorded, the other one is incomplete and just a few songs surviving on tape (see the other entry).','2011-04-09 00:00:00',1,0),(31,31,'Bob','Includes a couple of very unusual songs, but, be warned... the sound quality is poor.','2011-04-09 00:00:00',1,0),(32,32,'Bob','On the same CD as the one from the 18th July 1980. An incomplete recording, just a few songs remain...','2011-04-09 00:00:00',1,0),(35,35,'Bob','A cracking two set show featuring the Rockin&#145; Robins (Beth Harrington and Ellie Marshall). The second set is particularly enjoyable... everyone&#145;s loosened up and having fun.','2011-04-09 00:00:00',1,0),(36,36,'Bob','Set 2 sounds to have come from a different source to that for Set 1, and is a much better recording; hence a different rating for each of the sets.With the Rocking Robins & Michael Guardabascio. ','2011-04-09 00:00:00',1,0),(37,37,'Bob','With Curly Keranen, Michael Guardabascio and Ken Forfia, plus &#145;The Rockin&#145; Robins&#145; : Ellie Marshall and  Beth Harrington.Yoyos On Parade&#145; & &#145;Creeps On The March&#145; aren&#145;t really songs they&#145;re just a few lines while Jonathans messing about for a minute or two.','2011-04-09 00:00:00',1,0),(38,38,'Bob','With Beth Harrington.','2011-04-09 00:00:00',1,0),(39,39,'Bob','With Curly Keranen, Beth Harrington, Ellie Marshall, Ken Forfia, and Michael Guardabascio.','2011-04-09 00:00:00',1,0),(40,40,'Bob','Very clear - probably a soundboard recording. With Beth Harrington, Ellie Marshall, Ken Forfia, Michael Guardabascio, and Curly Keranen.','2011-04-09 00:00:00',1,0),(41,41,'Bob','With Beth Harrington, Ellie Marshall, Ken Forfia, Michael Guardabascio, and Curly Keranen.','2011-04-09 00:00:00',1,0),(42,42,'Bob','Right, I had this previously listed as New York 1982, and as a one CD show only, but now have a copy of the full show as below... the thing is that the one CD copy seemed to sound better than the new complete copy does (the 1 CD copy ran from fireside chat to Abdul & Cleopatra) so I now need to do some further sound checking and come up with the best recording.Here&#145;s the show... and by the way, &#145;Bring Back Springtime&#145; still stands out as a great unlisted and unrecorded song...','2011-04-09 00:00:00',1,0),(43,43,'Bob','Seems like &#145;Roadrunner&#145; is the only recording from this show - unless someone knows otherwise? ','2011-04-09 00:00:00',1,0),(44,44,'Bob','With Beth Harrington, Ellie Marshall, and Ken Forfia. A pretty short show this, at something like 30 minutes long. ','2011-04-09 00:00:00',1,0),(45,45,'Bob','With Beth Harrington, Ellie Marshall, Ken Forfia, Michael Guardabascio, and Curly Keranen.','2011-04-09 00:00:00',1,0),(46,46,'Bob','A neat sounding show, the 2nd of two nights at the Bottom Line, and with a very early acapella version of &#145;That Summer Feeling&#145;... it&#145;s pretty different here and sounds like it&#145;s completely new to the audience too; Jonathan describes this as his &#145;Summer Song&#145;...With Beth Harrington, Ellie Marshall, Ken Forfia, Michael Guardabascio, and Curly Keranen.','2011-04-09 00:00:00',1,0),(47,47,'Bob','A solo show in the main, except for a few songs with &#145;the Rockin Robins&#145; on each set, joined by Andy Paley on piano for &#145;Up In The Sky Sometime&#145;.','2011-04-09 00:00:00',1,0),(48,48,'Bob','Recently got hold of this one, and guess what... it&#145;s as good as the following nights show.And a couple of  very rare songs too.','2011-04-09 00:00:00',1,0),(49,49,'Bob','cover files available     This is a great little show! It sounds really intimate and of the 16 songs Jonathan plays 6 that I&#145;ve only heard here (well maybe one or two exist on a couple of other live shows but the performance here is spot on).This is one of my favorites and listened to lots.','2011-04-09 00:00:00',1,0),(50,50,'Bob','I&#145;d have probably graded this one as excellent if it hadn&#145;t have been for some very occasional loss of sound in one channel. With a few unusual songs choices that don&#145;t get performed too often, and a very unusual end of show poem...','2011-04-09 00:00:00',1,0),(51,51,'Bob','With  Beth Harrington, Ellie Marshall, and Michael Guardabascio.','2011-04-09 00:00:00',1,0),(52,52,'Bob','cover files available ','2011-04-09 00:00:00',1,0),(54,53,'Bob','With the Modern Lovers and Beth and Ellie (The Rockin&#145; Robins)','2011-04-09 00:00:00',1,0),(55,54,'Bob','Loads of unusual songs here, Jonathan&#145;s very chatty and joking throughout and everybody&#145;s having a great time. Lots of interaction between him and what is a pretty lively audience. A great show!','2011-04-09 00:00:00',1,0),(56,55,'Bob','A super fun show and one of the best we have! Lots of jokes, fooling around, and an unusual song list, plus, towards the end of the show Jonathan&#145;s joined on stage by The Baltimores, for a great version of......... well, what else but ........ The Baltimores!Jonathan at his very best!!!!','2011-04-09 00:00:00',1,0),(60,59,'Bob','One of the best sounding shows I have of The Modern Lovers from the early 1980&#145;s.Jonathan doesn&#145;t introduce all the band members so can&#145;t be sure of the full line-up tonight, but the performers included &#145;The Rockin&#145; Robins&#145; (Beth and Ellie), Curly Keranan, and Carla Brownlee on Saxophone. Carla&#145;s Sax is put to full use throughout and some of the songs have never sounded better','2011-04-09 00:00:00',1,0),(61,60,'Bob','cover files availableWith Jonathan on Sax and Curly Keranen on Acoustic Bass: no guitars! ','2011-04-09 00:00:00',1,0),(62,61,'Bob','With Curley & Ellie, and probably Jonathans Saxophone.','2011-04-09 00:00:00',1,0),(63,62,'Bob','A good show but the audience here is pretty rowdy and a sizeable number seem pretty inattentive to the performance, there&#145;s also quite a lot of chatting way too near the microphone, but, besides these gripes it&#145;s still an interesting recording and includes a couple of otherwise unknown songs - &#145;More Surprises&#145; and &#145;Let&#145;s Go Wild&#145; - apart from on this tape.','2011-04-09 00:00:00',1,0),(64,63,'Bob','Alongside Jonathan tonight are Ellie Marshall, Curly Keranen, Carla Brownlee (on Sax), Michael Guardabascio and one other performer whose name I can&#145;t quite hear, but sounds something like Scott (or Stan) Brook (?)','2011-04-09 00:00:00',1,0),(65,64,'Bob','Jonathan with the Modern Lovers: Ellie, Curly, and Michael Guardabascio; it&#145;s quite a short show, at something like 40 minutes, but a good one and includes &#145;Let&#145;s Go Wild&#145;.','2011-04-09 00:00:00',1,0),(67,66,'Bob','Excellent recording made for Radio-Bellevue, recorded through the soundboard and mixed on-the-fly, incorporating a couple of  ambience microphones standing in front of the stage. With Ellie Marshall and Curly Keranen.','2011-04-09 00:00:00',1,0),(68,67,'Bob','With Curly & Ellie.','2011-04-09 00:00:00',1,0),(69,68,'Bob','English music festival, Jonathan with Ellie Marshall and Curly Keranen.','2011-04-09 00:00:00',1,0),(70,69,'Bob','Very good audience recording of Jonathan with Ellie & Curly. Including an improvised and otherwise completely unknown song, &#145;Jonathan I feel so Bad&#145;&#145;, the words of which Jonathan seems to be spilling out, line by line, in a stream of consciousness style of improvisation.','2011-04-09 00:00:00',1,0),(71,70,'Bob','With Jonathan, Curly & Ellie Marshall. A few faults with the original taping : every once and a while the microphone seems to be getting a bit of a knock which then affects the recording levels for the next 30 seconds. This doesn&#145;t happen too much at the start though it&#145;s a lot more noticeable for the last 10 minutes.','2011-04-09 00:00:00',1,0),(72,71,'Bob','With Ellie and Curly, a great sounding performance, and several encores too.','2011-04-09 00:00:00',1,0),(74,73,'Bob','A great concert with a great version of &#145;Affection&#145; tied into the concert cause.','2011-04-09 00:00:00',1,0),(75,74,'Bob','With Asa Brebner and Andy Paley.','2011-04-09 00:00:00',1,0),(76,75,'Bob','A pretty good show with Asa Brebner, and almost certainly Andy Paley. The recording ends a little before the end of the show and just a few seconds into &#145;My Jeans&#145;.  It&#145;s one of the few shows I have that includes &#145;Lets say we just met&#145;, and it&#145;s a cracking version performed on this one - great!!!','2011-04-09 00:00:00',1,0),(78,77,'Bob','A nice show, with a very atmospheric outdoors feel to it somehow; kids talking and playing in the background  between songs and a very enthusiastic band of Modern Lovers (Jonathan with Andy Paley & Asa Brebner) plus a couple of Jonathan&#145;s jokes thrown in between songs too. ','2011-04-09 00:00:00',1,0),(79,78,'Bob','A short performance from this huge and popular UK Music Festival, at about only 40 minutes long or so, because of the needs of the Festival organizers to get on with setting up their next act. The highlights are, to my mind, &#145;Tell how you Feel&#145; and a great and spirited version of &#145;Louie Louie&#145;.Maybe this tape doesn&#145;t have the best of sound quality - but still a great show!','2011-04-09 00:00:00',1,0),(81,80,'Bob','Yo Jojo and This Kind Of Music are both on a poor sounding taping that we also have, but not on the CD copy.','2011-04-09 00:00:00',1,0),(82,81,'Bob','Jonathan with Asa Brebner and Andy Paley.','2011-04-09 00:00:00',1,0),(84,83,'Bob','A great and hugely extended &#145;This kind of Music&#145;, something like 15 minutes in total, adds to a very memorable performance. ','2011-04-09 00:00:00',1,0),(85,84,'Bob','Excellent apart from a couple of songs where Jonathan&#145;s singing away from the microphone. ','2011-04-09 00:00:00',1,0),(89,87,'Bob','Great show and lots of Sax!','2011-04-09 00:00:00',1,0),(90,88,'Bob','With Brennan Totten and Andy Paley.','2011-04-09 00:00:00',1,0),(91,89,'Bob','Nice show with the full band :Jonathan, Brennan Totten and Andy Paley, plus plenty of Sax too! ','2011-04-09 00:00:00',1,0),(93,91,'Bob','Another neat sounding show; Jonathan&#145;s trying his best with the local lingo, the music and atmosphere is great and he&#145;s playing Sax loads. Vincent van Gogh, Wipeout, La Bamba, and Egyptian Reggae all given a full Sax blowout!','2011-04-09 00:00:00',1,0),(95,93,'Bob','Another of those great sounding mid-eighties shows with a lot of Saxophone.cover files available','2011-04-09 00:00:00',1,0),(96,94,'Bob','Jonathan with Brennan Totten & Andy Paley.','2011-04-09 00:00:00',1,0),(97,NULL,'Bob','A very low key and relaxed performance with some great guitar playing, particularly on &#145;That Summer Feeling&#145; and &#145;Everything&#145;s got to be right&#145;.','2011-04-09 00:00:00',1,0),(98,NULL,'Bob','cover files available Jonathan breaks a string mid set and then spends the best part of the next 10 minutes taking time out telling jokes, the jokes are awful but the delivery&#145;s great  - Our kids really like the frog joke!   ','2011-04-09 00:00:00',1,0),(99,95,'Bob','Jonathan&#145;s pretty chatty and comes up with plenty of ad libs during &#145;That Summer Feeling&#145;, and Brennan Totten&#145;s here too.','2011-04-09 00:00:00',1,0),(102,98,'Bob','With Brennan Totten & Johnny Avila','2011-04-09 00:00:00',1,0),(103,99,'Bob','With Brennan Totten and Johnny Avila. ','2011-04-09 00:00:00',1,0),(104,NULL,'Bob','With Brennan Totten & Johnny Avila.','2011-04-09 00:00:00',1,0),(107,101,'Bob','A great show with Brennan Totten & Johnny Avila. A really lively one this one, the band is on top form: full of enthusiasm, and playing to a highly excited crowd. Some excellent guitar work is here too, especially on &#145;Chewing gum wrapper&#145; and &#145;Conga Drums&#145; - this is by far the best version of &#145;Conga Drums&#145; that I&#145;ve yet heard.Unfortunately, the tape runs out near the end of &#145;Walter Johnson&#145;, the shows second encore, just a couple of lines short of what would have been the end; so unfortunately, the recording comes to a bit of an abrupt ending - this though is probably the only slight flaw with the recording.Has a great atmosphere of an excellent show, superbly captured!!!!!','2011-04-09 00:00:00',1,0),(108,102,'Bob','With Brennan Totten, Johnny Avila and a lot of Sax!','2011-04-09 00:00:00',1,0),(109,103,'Bob','With Brennan Totten & Johnny Avila.','2011-04-09 00:00:00',1,0),(113,107,'Bob','A fairly lively audience for this show, and with a sound quality that is probably a little better than I&#145;ve marked it in the main, but, the sound quality drops away for all of &#145;California Desert Party&#145; and also for part of &#145;UFO Man&#145; so I&#145;ve rated this one as &#145;good&#145; only. Even so, it&#145;s a pretty good recording.Brennan Totten does the singing for a couple of songs midway through the show (Born to be Wild & My Baby). With a pretty funny encore.','2011-04-09 00:00:00',1,0),(114,108,'Bob','With Johnny Avila and Brennan Totten','2011-04-09 00:00:00',1,0),(115,109,'Bob','With Johnny Avila and Brennan Totten','2011-04-09 00:00:00',1,0),(116,110,'Bob','With Johnny Avila and Brennan Totten. Brennan&#145;s doing the singing on &#145;Born to be Wild&#145;.','2011-04-09 00:00:00',1,0),(118,112,'Bob','With Johnny Avila and Brennan Totten.','2011-04-09 00:00:00',1,0),(119,113,'Bob','With Johnny Avila & Brennan Totten; includes a great sounding &#145;Affection&#145; peppered with ad libs. ','2011-04-09 00:00:00',1,0),(120,114,'Bob','Last date of the tour before the band are heading home to the states, and a fun show it is too! including a great version of  &#145;Hospital&#145;. Brennan Totten, guitar, and Johnny Avila, drums. At the end of the show Jonathan can be heard throwing cards out into the audience, imploring people to use them to write him - \"I always write back, sometimes it takes a while, but I write back!\"','2011-04-09 00:00:00',1,0),(121,115,'Bob','A cracking show that includes an excellent and completely unknown song... &#145;Wild Wild Party&#145;, never seen it listed anywhere before... as well as a very early version of &#145;You can&#145;t talk to the Dude&#145; introduced as a brand new song...  and with very different lyrics too. Recommended.','2011-04-09 00:00:00',1,0),(122,116,'Bob','Jonathan&#145;s pretty talkative tonight with a very lively audience that&#145;s only too willing to join in with the songs wherever possible. A super show for all, that ends with Jonathan saying how much he&#145;s enjoyed himself, unusually he&#145;s more than happy to do several encore&#145;s on this one. S. E. Rogie comes on stage as guest to sing &#145;African Lady&#145;, one of Sooliman&#145;s songs that&#145;s usually covered by Jonathan as an instrumental. ','2011-04-09 00:00:00',1,0),(123,117,'Bob','From an FM broadcast \" O3 Musicbox Live \"  Austrian Radio (ORF). With Brennan Totten & Johnny Avila.With Brennan Totten & Johnny Avila.','2011-04-09 00:00:00',1,0),(125,119,'Bob','A solo show and soundboard recording','2011-04-09 00:00:00',1,0),(128,122,'Bob','A nice show this one, a bunch of instrumentals performed near the beginning and a great version of &#145;Closer&#145;.&#145;Fender Stratocaster&#145; and &#145;Make a Mistake&#145; are both described as new songs.','2011-04-09 00:00:00',1,0),(129,123,'Bob','A pretty interactive and friendly show with some nice chat between songs too, and an especially nice moment when a woman joins Jonathan up on stage, unexpectedly, part way through &#145;Affection&#145;.Some slight background hiss during the early part but this fades away part way though. ','2011-04-09 00:00:00',1,0),(130,124,'Bob','Jonathan&#145;s pretty chatty tonight... inviting questions from the audience, etc, more so during the first set than the second. There&#145;s an interesting explanation of why &#145;Roadrunner&#145; doesn&#145;t get performed much anymore and also an early embryonic version of You Can&#145;t Talk to the Dude&#145;.','2011-04-09 00:00:00',1,0),(131,125,'Bob','A Radio broadcast of the full show, quite long, at about 1 1/2 hours and with many encores. The Spanish presenters do chip in quite a bit between some songs, but nothing too much and the show isn&#145;t spoilt . A very good recording!','2011-04-09 00:00:00',1,0),(133,127,'Bob','Not the best of sound with this one... it&#145;s a little quiet and sounds like the venue was a large cavernous hall so a bit hollow sounding.','2011-04-09 00:00:00',1,0),(135,129,'Bob','Our first recording that we got from a friend years ago, until recently this was the only live recording we had too. It&#145;s a great show as well and another favorite, &#145;Ring of Fire for Sweden!!!!&#145; (You&#145;ll know what I mean when you hear it - it&#145;s a very funny recording!) ','2011-04-09 00:00:00',1,0),(136,130,'Bob','Jonathans pretty talkative on this one, there are just one or two flaws with it, it cuts out for about 20 seconds during &#145;hot nights&#145; and also the recording stops during &#145;At night&#145; just before the end of the show.','2011-04-09 00:00:00',1,0),(138,132,'Bob','A long solo show that includes an early version of &#145;When She Kisses Me&#145;.','2011-04-09 00:00:00',1,0),(142,136,'Bob','Another great show with several nice moments; the best of which occurs just when you think it&#145;s about to end - an unexpected and great &#145;I eat with Gusto&#145; finale. Excellent.','2011-04-09 00:00:00',1,0),(143,137,'Bob','A Very Clear Soundboard recording','2011-04-09 00:00:00',1,0),(147,141,'Bob','A rowdy and very lively audience; Jonathan joins &#145;the Skeletons&#145; for the first 3 songs...','2011-04-09 00:00:00',1,0),(149,143,'Bob','Solo show. The sound quality on this one  is just awful - like it was recorded in a biscuit tin! One for completists only, a pity coz Jonathan sings a couple of songs in Italian. ','2011-04-09 00:00:00',1,0),(151,145,'Bob','A good solo show with quite a bit of chat in Italian...','2011-04-09 00:00:00',1,0),(152,146,'Bob','A few great standout moments, particularly so with Monologue on Bermuda, Pablo Picasso, and a very early sounding version of Velvet Underground, for which Jonathan is still playing about with lyrics... sounds pretty different here!','2011-04-09 00:00:00',1,0),(153,147,'Bob','It&#145;s a great solo show, of very good quality, and a new one to me. The only small flaw that I&#145;ve noticed is at about 3 minutes 15 into &#145;This Kind of Music&#145;. There&#145;s a 1/2 second bit where some crowd noise, or something like that, cuts in over the top of the song, the track then continues as normal. That&#145;s how the CD arrived. Also, this show could be from the 10th August or 8th October, 1991, as it came labeled 10/8/91; I&#145;ve gone for the August date here, but maybe someone has a ticket stub or flyer which would confirm the date either way?','2011-04-09 00:00:00',1,0),(154,148,'Bob','Jonathan is speaking Italian throughout this one, dropping some into the lyrics on a few songs, and even manages to do the whole of  &#145;Monologue on Bermuda&#145; in Italian. ','2011-04-09 00:00:00',1,0),(155,149,'Bob','Other than it was recorded in Canada in the 1990&#145;s no other info came along with this show. My best guess dates it as sometime in late 1991 - going by the song choices and Jonathans comments between songs. An early version of &#145;Let Her Go Into The Darkness&#145; is introduced here as a brand new song, \"not even on the new album that just came out\" - Possibly, &#145;Having A Party With Jonathan Richman&#145; which, far as I know, was released  in late September 1991.About half the show looks to be here- The taping cuts out straight after Jonathan calls an intermission.','2011-04-09 00:00:00',1,0),(156,150,'Bob','This is a really funny recording; Jonathan has a lot of fun trying out his French with this dual language audience - A great show!','2011-04-09 00:00:00',1,0),(158,152,'Bob','A great recording - apart from it being a bit quiet - and an excellent solo show. Jonathan&#145;s in a great mood throughout and has loads of fun with the audience.','2011-04-09 00:00:00',1,0),(161,155,'Bob','This one came with the Palomino show above, but without any info about where or when it was recorded, so the date&#145;s a bit of a guess... a nice recording though.','2011-04-09 00:00:00',1,0),(162,156,'Bob','The date for this one I&#145;ve had to take a bit of a wild guess at, coz the guy who sent me it was not too sure about when the recording was first made. He also said that this is about 1/2 of what the complete show was when first broadcast; so, unfortunately, this is a shortened and edited up version.All that said it&#145;s still a great show! Jonathan&#145;s having a whale of a time with his audience and he even sings a Spanish version of &#145;Reno&#145;.Hopefully the rest of the show will eventually turn up, but at present the song list is :-','2011-04-09 00:00:00',1,0),(164,158,'Bob','This is about the very best of all the live recordings - Jonathan&#145;s on great form, some great songs, nice chat and the audience are having a hoot too; there are many, many highlights, and all with a sound quality that is just excellent!Personal Highlight - &#145;I eat with Gusto, Damn You Bet!&#145;This is a must have!!','2011-04-09 00:00:00',1,0),(165,NULL,'Bob','A flaw with the recording on this one. The sound&#145;s pretty clear but for the first third of the show until part way through &#145;Action Packed&#145; it&#145;s only recorded onto the right channel; from there on though it&#145;s okay and the rest of the show sounds fine.','2011-04-09 00:00:00',1,0),(166,159,'Bob','A great show including an outstanding version of &#145;Monologue on Bermuda&#145; - the full story is here with two, yes, two songs within a song, &#145;Here come the Martian Martians&#145; &  &#145;Abominable Snowman in the Market&#145;,  before moving back to where we started at &#145;Down in Bermuda&#145; - Excellent.It&#145;s also one of the few shows I have, so far, that includes a live version of \"Tandem Jump!\" so, set your altimeters...another - Highly recommended!','2011-04-09 00:00:00',1,0),(168,161,'Bob','Soundboard recording - but as the audience are hardly being picked up there is little or no live atmosphere present. Probably not a bad show but not a favourite of mine - I much prefer hearing shows where there&#145;s lots of interaction between Jonathan and the audience.','2011-04-09 00:00:00',1,0),(169,162,'Bob','A great show and a pretty lively audience too; just Jonathan with support from a drummer, Joseph Marc (?). Highlight of the night is a great sounding &#145;Monologue on Bermuda&#145;.','2011-04-09 00:00:00',1,0),(170,163,'Bob','A fairly quiet recording this one ,Jonathan is joined on stage towards the end of the show by the Rockin&#145; Robin&#145;s: Beth Harrington and Ellie Marshall.','2011-04-09 00:00:00',1,0),(171,164,'Bob','cover files available I really like this recording; lots of fun with the audience in this in-store&#145; appearance and all are obviously having a great time. It only lasts something like 11 minutes in total but it&#145;s very, very playable.Until recently I thought this was an audio recording only, but I&#145;ve since heard that it&#145;s actually from a video recording someone made - so film footage of this mini concert exists too!','2011-04-09 00:00:00',1,0),(172,165,'Bob','A top-quality recording with the full Bermuda Monologue and a great sounding &#145;Velvet Underground&#145;, including snatches of 3 songs by the Velvets - Sister Ray, What Goes On & Foggy Notion -  and some nice chat too.','2011-04-09 00:00:00',1,0),(173,166,'Bob','Features an ace version of Pablo Picasso and quite a lot of ad-libbing... and a new song that&#145;s only on this recording: &#145;She brings out the best in me&#145;... plus an early version of &#145;Rock and Roll Drummer&#145; with different verses.','2011-04-09 00:00:00',1,0),(176,169,'Bob','Really good recording, On the same CD as 91X Radio interview from the same day.','2011-04-09 00:00:00',1,0),(178,171,'Bob','Sounds like this is an outdoor music festival; a fairly short show at about 45 minutes long.','2011-04-09 00:00:00',1,0),(179,NULL,'Bob','A fun show with a few nice moments: especially so on the very funny and extended &#145;Down in Bermuda&#145; & &#145;You&#145;re Crazy for taking the Bus&#145;.','2011-04-09 00:00:00',1,0),(186,178,'Bob','The recording&#145;s a bit quiet unfortunately. It includes though a great version of &#145;You&#145;re crazy for taking the Bus&#145; - A very funny and extended tale of life on the bus!','2011-04-09 00:00:00',1,0),(187,179,'Bob','With Andy Paley on drums; tonight&#145;s show includes a pretty rare song cover, &#145;Polk Salad Annie&#145; by Tony Joe White, which, as far I know is only on this recording.','2011-04-09 00:00:00',1,0),(189,181,'Bob','Quite a good recording until the start of the last four songs, but from there on the recording is pretty flawed, sounds like there was a very bad burn done sometime ago, and because of this the end of the show is pretty much unplayable.','2011-04-09 00:00:00',1,0),(192,184,'Bob','With Curly Keranen and Don Spindt (?).','2011-04-09 00:00:00',1,0),(193,185,'Bob','With Tommy Larkin.','2011-04-09 00:00:00',1,0),(195,187,'Bob','This one is a little muffled, and also very quiet for the first couple of songs too... the sound does improve part way through &#145;Blue Moon&#145;... but even so, no great shakes!','2011-04-09 00:00:00',1,0),(198,190,'Bob','With Tommy Larkins on drums and Jonathan on electric guitar throughout the show.A very clean recording overall, affected only by some slight distortion to the high end vocals pretty near the end of the show, but just once or twice and only for a second or two','2011-04-09 00:00:00',1,0),(202,194,'Bob','With Tommy Larkins, Nick Augustine, and Dan Eisenberg','2011-04-09 00:00:00',1,0),(203,195,'Bob','A full band recording but not a good one - with a bit of a muffled sound and far too much bass. ','2011-04-09 00:00:00',1,0),(206,198,'Bob','The first of three great sounding recordings from Japan.','2011-04-09 00:00:00',1,0),(208,200,'Bob','A very clear recording including several new songs.   ','2011-04-09 00:00:00',1,0),(209,201,'Bob','With &#145;The Falcons&#145;... Tommy Larkins (Drums)  Nick Augustine (Bass) and Dan Eisenberg (Organ).','2011-04-09 00:00:00',1,0),(212,204,'Bob','A few faults with the sound develop during the last couple of songs on this one, but it&#145;s a great show and Jonathan does several encores before leaving the stage to rapturous applause.','2011-04-09 00:00:00',1,0),(213,205,'Bob','A few songs by Jonathan and Tommy at the beginning of this great sounding show with many other acts. Jonathan is joined on stage by ex-Modern Lover Ernie Brooks for a couple of songs. The other performers on the night were- Ronnie Spector, Leonard Graves Phillips (the Dickies), The Pristeens, Lenny kaye, Jessie Malin, Joey Ramone, and also the Dictators.','2011-04-09 00:00:00',1,0),(214,206,'Bob','A pretty good one this: especially so on &#145;Pablo Picasso&#145; and &#145;Let her go into the Darkness&#145; both of which have some great and extended guitar playing. Great performance!','2011-04-09 00:00:00',1,0),(222,214,'Bob','A slightly muffled sound here: it does though include a couple of songs unique to this show.','2011-04-09 00:00:00',1,0),(225,217,'Bob','Five songs and some chat from a recording for Andy Kershaw&#145;s show on the BBC, aired on the 26th of February 1999.','2011-04-09 00:00:00',1,0),(226,218,'Bob','The first few seconds of this sound a little strange but the tape soon perks up. &#145;Velvet Underground&#145; is the highlight for me on this one, Jonathan throws in some great sounding snatches of &#145;Sister Ray&#145; and &#145;What goes on...&#145; probably the best version of &#145;Velvet Underground&#145; I&#145;ve yet heard.','2011-04-09 00:00:00',1,0),(227,219,'Bob','Sounds a pretty good show this one, but, I don&#145;t think the recording can have the whole thing, as it cuts out part through the last song.','2011-04-09 00:00:00',1,0),(234,226,'Bob','Not a bad recording but with a couple of silent points on a few of songs it&#145;s rated as &#145;good&#145; only. ','2011-04-09 00:00:00',1,0),(235,227,'Bob','cover files available Excellent recording of a very, very good show, with a few unusual songs and a great finale. Highly recommended!','2011-04-09 00:00:00',1,0),(236,228,'Bob','cover files available','2011-04-09 00:00:00',1,0),(237,229,'Bob','With a bit of a muffled sound unfortunately...','2011-04-09 00:00:00',1,0),(238,230,'Bob','cover files available','2011-04-09 00:00:00',1,0),(239,231,'Bob','A great sounding show, Jonathan sings in French - lots! Just look at the song list...','2011-04-09 00:00:00',1,0),(241,233,'Bob','We were at this one and enjoyed it loads; it&#145;s a good show but unfortunately the recording has some slight digi-noise in the background on some songs, nothing that spoils the show but it&#145;s noticeable in the quieter moments, more so towards the end than the beginning. Because of this I think I prefer the Manchester 2001 show to this one.','2011-04-09 00:00:00',1,0),(243,235,'Bob','Jonathan toured with Belle and Sebastian throughout their West Coast Tour as support act (surely some mistake here!). Have read some of the reports about the shows and regularly Jonathan was reported as having &#145;virtually stolen the show&#145; from Belle. This is a very clear recording of both nights at the Wiltern.','2011-04-09 00:00:00',1,0),(244,236,'Bob','This is a really good recording and definitely deserves to be classed as Excellent!   ','2011-04-09 00:00:00',1,0),(246,238,'Bob','A super show that includes quite a few rarities.','2011-04-09 00:00:00',1,0),(248,240,'Bob','Copied straight from the taper. Most of the show&#145;s here, there&#145;s just a couple of songs that are missing because of some background noise.Some background info to the show... apparently Jonathans guitar had got broken during the flight over so somebody lent him a couple of guitars on the night, and a few songs near the end are played with electric guitar. I&#145;ve had to take guess at the title of the very last song, it seems to have only been played on this particular tour, and even then just a few times.','2011-04-09 00:00:00',1,0),(252,244,'Bob','A pretty good show but sometimes the microphone picks up too much of the near distance sounds, for example clapping, and then loses the recording level for a few seconds afterwards.','2011-04-09 00:00:00',1,0),(253,245,'Bob','A super sounding show and a pretty long concert. Jonathan does quite a few French songs tonight, as well as a French version of &#145;Not in my Name&#145;.','2011-04-09 00:00:00',1,0),(254,246,'Bob','Just a few crackles during &#145;Springtime in New York&#145; but otherwise all okay.This is one of the few recordings we have that includes &#145;Not in my Name&#145;, a short verse on the pending American/British attack on Iraq, he didn&#145;t choose to do it when we saw him in Liverpool a week later.','2011-04-09 00:00:00',1,0),(255,247,'Bob','A great show this!We recorded this one ourselves from a great position, in the centre and about 15 feet out from the stage. The recording came out nicely and Jonathan plays quite a few new songs. He also has a really funny new section mid way through ‘Let her go into the darkness‘, involving four languages, great stuff!','2011-04-09 00:00:00',1,0),(260,252,'Bob','Another great sounding Italian show, and straight from the taper too...  It&#145;s a fairly short set though, of maybe only 50 minutes, but a very good recording, and it also gives a good example of Jonathan&#145;s multi language abilities... ','2011-04-09 00:00:00',1,0),(262,254,'Bob','cover files available','2011-04-09 00:00:00',1,0),(263,255,'Bob','Ace sounding show with plenty of new songs too, I&#145;m not yet sure of the titles so I&#145;ve had to take a bit of a guess for now. The new songs sound great by the way!','2011-04-09 00:00:00',1,0),(264,256,'Bob','The first of two recordings that we made ourselves during the Spring 2004 tour, the other one was at the next night&#145;s show, &#145;Night and Day Cafe&#145;, Manchester: both nights were excellent and featured a clutch of new songs, some of which, hopefully, will find their way on to Jonathan&#145;s next official CD.Tonight&#145;s show is in a small pub-type venue with a pretty tightly packed audience, well pretty tightly packed where we were anyway, of probably about 150 people, tops. There&#145;s a little bit of conversation picked up on this one, but not too much, and it sounds fine.Tonight&#145;s highlight is a great sounding &#145;Let her go into the Darkness&#145; with the full boyfriend/girlfriend argument done in all five languages... English, Spanish, French, Italian, and Hebrew... great fun!A bit of special show for me too, coz it&#145;s the first one that I could take my daughter to: she&#145;s now just old enough to start going to see shows, so I was really pleased to be able to take her to a Jonathan one, and Yes, she had a great time too! her words afterwards were... &#145;I enjoyed it loads...take me again!!&#145;','2011-04-09 00:00:00',1,0),(265,257,'Bob','Another of our own recordings, done from right near the front of stage...came out pretty good too... another small pub-type venue, but a little larger than the night before.','2011-04-09 00:00:00',1,0),(266,258,'Bob','Another great show from the UK spring tour... and the last recording of a run of four successive nights from different cities.You can clearly hear, across the four nights, a couple of new songs being developed and worked on...  &#145;Older Girl&#145; and &#145;For drama we have the seasons&#145;.','2011-04-09 00:00:00',1,0),(269,261,'Bob','A pretty good show this, with quite a lively audience and a pretty long one. The sound for the first 30 seconds is a bit off but from there on the recording sharpens up and the sound is pretty good for the rest of the night. Like I said it&#145;s a pretty long one this - at about one and three quarter hours and with several encores... Jonathan has has said in the past how much he enjoys playing to Spanish audiences.. this is a good example why... the rapport&#145;s great here!','2011-04-09 00:00:00',1,0),(270,262,'Bob','I received a few short extracts from this one a while back - just 3 or 4 songs in total and of pretty poor quality really; the taper wasn&#145;t happy with it either - and had been hoping that someday a better recording would  turn up? Well, it now turns out that there was someone else there taping, and he got the full show. So, here&#145;s a complete copy...','2011-04-09 00:00:00',1,0),(274,266,'Bob','An absolutely spot on recording with extremely crisp and clear sound, right up there with Caesars Tampa 92 for sound quality and one of the best sounding shows we have.','2011-04-09 00:00:00',1,0),(276,268,'Bob','A pretty short concert from the Island of Mallorca - at about an hour long only. Not a bad recording though.','2011-04-09 00:00:00',1,0),(277,269,'Bob','Not a good recording here, too much background noise and its a bit muffled as well. ','2011-04-09 00:00:00',1,0),(278,NULL,'Bob','A good show this one, Jonathan&#145;s quite talkative and speaking mainly in Spanish throughout the evening.','2011-04-09 00:00:00',1,0),(279,270,'Bob','Jonathan & Tommy did three consecutive nights at the Jazz Cafe this is the 2nd one and the whole concert&#145;s here. The recording from the following night is incomplete.','2011-04-09 00:00:00',1,0),(280,271,'Bob','This was a pretty long and stand out show from all accounts, and most of it&#145;s here, but not all unfortunately... so the recording cuts out maybe 20 minutes before the end, even so it&#145;s a pretty good recording.','2011-04-09 00:00:00',1,0),(282,273,'Bob','This show and the ones directly below and above it were recorded by the same taper... they&#145;re all high quality recordings, each of them but, of the three, this one sounds the best, to my ears anyway. The atmosphere is just better somehow, so the performance has moved up a notch... What are the highlights?Well &#145;El Joven se Estremece&#145;, and &#145;Joy over Sorrow&#145; are both sounding terrific tonight...','2011-04-09 00:00:00',1,0),(289,280,'Bob','Has a bit of a muffled sound but includes a few unrecorded songs.','2011-04-09 00:00:00',1,0),(296,287,'Bob','Recorded by ourselves, but from too far away this time... a great show on the night that just wasn&#145;t done justice by the recording...','2011-04-09 00:00:00',1,0),(300,291,'Bob','Chiusa la festa, chiusa la sera (?) (in Italian, translates as &#145;ends the party, ends the night?&#145;)','2011-04-09 00:00:00',1,0),(302,293,'Bob','Jonathan&#145;s in a really good mood tonight, still on an up from the last nights show. Its a fun recording too, with lots of people singing along... especially on the Spanish language songs.','2011-04-09 00:00:00',1,0),(311,302,'Bob','A faulty recording here, the sound keeps dropping out from the left and right channels randomly, so not an easy listen.','2011-04-09 00:00:00',1,0),(312,303,'Bob','Recording levels seem to have been set too low - a pretty quiet recording.','2011-04-09 00:00:00',1,0),(318,309,'Bob','First rate recording this one!','2011-04-09 00:00:00',1,0),(321,312,'Bob','My own recording from pretty near the front of the audience, and about 10 or 12 feet from Jonathans guitar. An intimate venue with good acoustics.','2011-04-09 00:00:00',1,0),(323,314,'Bob','A very clear audience recording, Jonathan with Tommy Larkins on drums.','2011-04-09 00:00:00',1,0),(325,316,'Bob','Jonathan with Tommy Larkins.','2011-04-09 00:00:00',1,0),(337,291,'JB','Bajando, bajando por ceniza y mineral (?) is a new Spanish song, which may be titled &acirc;&#128;&#152;Bajo la tierra, en el subsuelo&acirc;&#128;&#152; - Under t