ktra Studios, LA, April 197210-11 From Dinky Dawsons Studio, Boston with Kim Fowley, Summer 197212 Gold Star Studios, LA, with Kim Fowley, October 197313 Live Radcliffe, Cambridge, October 197214 - 17 The Mercer Arts Center, NYC, New Years Eve 197218 Cambridge Boathouse, MA, 1972 Also, - Tracks 5,7, and 9, are among the extra tracks on the 2003 Castle Music re-issue of \'The Modern Lovers\' (CMQCD 782) Track 6 was on the original 1976 release of \'The Modern Lovers\', but the version here has some brief studio chat before it begins.','2011-10-14 19:51:25',1,0),(461,359,'Bob','A CD bootleg released in 1998 by Punk Vault(PVCD1003). The sound is generally pretty good','2011-10-14 19:52:10',1,0),(462,324,'Bob','A quirky little recording. Recorded by Jonathan and given as a gift to a friend, Laura, eventually it somehow found it\'s way onto the tape trading circles. This is a much improved copy to what was originally available.','2011-10-15 21:30:20',1,0),(464,363,'JB','&quot;Here Come the Martian Martians&quot; has cuts','2011-10-15 21:55:05',0,0),(465,1,'Bob','Ok, I\'d better say a few words... When I received both this and the following one (Cambridge Boathouse) they were mixed up and named as Boston 1971 & 1973, but I think they were accidentally mis-labeled at some time.   Why do I think this? Well, by doing a comparison of some tracks included in Precise Modern Lovers Order & also by checking out some other people\'s early Modern Lovers web pages: they tie in as actually being from Harvard University 1971 & Cambridge Boathouse.  Quality-wise though, the recording sound is pretty rough, especially when you compare them to the cleaned up songs included on Precise Modern Lovers Order, but, because some are not included on either Precise Modern Lovers Order or Live at the Longbranch Saloon, then they are probably only available within this recording. So, that\'s my ten cents, enough said...','2011-10-16 14:21:38',1,0),(466,364,'Bob','A 90 minute interview with Jonathan for Varulven magazine; along with Joe Viglione and Fred Pineau. ','2011-10-16 14:40:34',1,0),(467,12,'JB','This is the early show of two shows played that day','2011-10-16 14:54:33',0,0),(468,13,'JB','This is the late show of two shows played that day ','2011-10-16 14:56:04',0,0),(469,16,'JB','In late \'77','2011-10-16 15:00:16',0,0),(470,366,'JB','In Houston Hall. &quot;Roadrunner&quot; is cut','2011-10-16 15:10:03',0,0),(471,367,'Bob','Presented by Kid Jenson \'Round Table\' was a platform for guests to review some of the latest singles out in the UK. Jonathan and Ed Stewart are the shows guests, but, it\'s a  pretty crappy set of singles out that week unfortunately - Bonny Tyler, Althea and Donna, Billy Joel, Peter Sarstedt... in between songs Jonathan explains a little about the music he likes, etc... About 40 minutes long.','2011-10-16 15:21:06',1,0),(472,368,'Bob','Studio interview in between a few of Jonathan recordings (Abdul and Cleopatra, Buzz Buzz Buzz and  the \'Oh Carol \' version of \'Morning of our lives\' are played).About 15 minutes long.','2011-10-16 15:23:57',1,0),(473,369,'JB','This radio show starts out with a little ditty called something like &quot;We\'re the Modern Lovers&quot;','2011-10-16 15:30:26',0,0),(474,370,'Bob','A little bit of echo for the 1st couple of  songs only, but excellent for the rest of the show.','2011-10-16 15:33:45',1,0),(475,370,'JB','This recording is from KRO Radio','2011-10-16 15:37:13',0,0),(476,371,'Bob','Good  live in the studio recording of the Modern Lovers, with nice and relaxed performance. Some nice chat between songs too.','2011-10-16 15:42:32',1,0),(477,25,'JB','This is the early show','2011-10-16 15:45:12',0,0),(478,372,'Bob','Studio Concert which unfortunately cuts out part way through My love is a Flower.','2011-10-16 15:51:18',1,0),(479,373,'Bob','The Modern Lovers on a Dutch music show.','2011-10-16 15:55:10',1,0),(480,374,'Bob','A really good recording and something of rarity from this time. Tonight\'s and the following nights recording are solo performances, a lot of fun, and full of spontaneity. An added bonus too is the inclusion of  a rare recording of \'I Don\'t Want No Nuclear Power Plants (in My Life)\', a song once planned to be released as a single with the Beserkley label. This release never came to be and the song quickly dropped from Jonathans live shows.','2011-10-16 16:03:45',1,0),(481,375,'JB','An incomplete first set','2011-10-16 16:09:58',0,0),(482,376,'Bob','A few songs from his latest LP, \'Back in Your Life\', are played (The songs are - Back in Your Life, Natures Mosquito, Affection and Roadrunner) Jonathan gives a little bit of info about each and also about his new LP. ','2011-10-16 18:17:29',1,0),(485,377,'Bob','Said to have been recorded in Jonathans apartment in Cambridge. With Leroy Radcliffe, Andy Paley, Ellie Marshall, and  another backing singer, Liz Does.','2011-10-16 18:27:32',1,0),(486,377,'JB','The summer of 1979','2011-10-16 18:27:40',0,0),(487,378,'Bob','Highly recommended! Previously listed here as \'Unreleased Lost Elpee, 1980\'. These seem be better identified as the eight-track demos that were recorded at Perfect Crime Studios during late summer of 1979 (see Tim Mitchell\'s book \'There\'s Something About Jonathan\' - page 124).','2011-10-16 18:31:37',1,0),(488,379,'Bob','In the book \'There\'s Something About Jonathan\' reference is made to a recording done at Gold Star Studios, Los Angeles, involved a full orchestra, \'Cupid \' and \'Lets Take The Long Way Home\' both look to be from this session. I\'m not sure about the other two, but as they arrived on the same CD I\'ll leave them here for now.','2011-10-16 18:36:09',1,0),(489,379,'JB','Late 1979','2011-10-16 18:36:24',0,0),(490,380,'Bob','A strange show this one. A mix of live interview & performance in front of an audience. It starts off with someone mimicking Jonathan and then a bizarre who is the real Jonathan contest happens, add to this some truly dumb ass questions from the interviewer and this makes a very strange tape indeed. The plus side of all this is that intermingled within is a very nice short performance from Jonathan.','2011-10-16 18:39:04',1,0),(491,380,'JB','&quot;New England&quot; is cut','2011-10-16 18:39:46',0,0),(492,382,'Bob','Previously listed as \'Studio Session 1982/3\'. This looks better identified as the session recorded at Capitol Recording Studios, Los Angeles, in late 1980 (see Tim Mitchell\'s book \'There\'s Something About Jonathan\' - page 130).By the way, there\'s a short CD circulating, called \'Jonathan Goes Funky\' which is made up of  six tracks from this session. ','2011-10-16 18:51:43',1,0),(493,383,'Bob','Short tape of Jonathan with Joe Viglione, John Hovorka, and Fred Pineau','2011-10-16 18:54:09',1,0),(494,383,'JB','Astral Plane is cut','2011-10-16 18:54:27',0,0),(495,386,'Bob','A Modern Lovers Bootleg that originally came out vinyl, I think, in the late eighties, and has long since been copied to CD.   The scanned back cover I have describes it as \'A limited edition of 300 copies\'(#253/300)\'.','2011-10-16 19:03:49',1,0),(496,39,'JB','First Set','2011-10-16 19:27:37',0,0),(497,387,'Bob','A Bootleg CD circulating on Wild Child Records (?) The cover describes the recording as &quot;unreleased demo version with bonus tracks&quot;. It seems likely that these recordings were done at Sunset Studios, Burbank, in Autumn 1981. (see Tim Mitchell\'s Book, \'There\'s Something About Jonathan\' - page 132). Most of the recordings are very similar to those that were released on &quot;Jonathan Sings!&quot; , though a couple didn\'t make it onto the record.','2011-10-16 19:34:18',1,0),(498,387,'JB','Autumn 1981','2011-10-16 19:34:29',0,0),(499,390,'Bob','This is a collection of songs that someone put together of lots of Jonathans rarer live songs from various other boots complied onto the one CD. A nice CD this but as I listen U can\'t help wondering where the rest of the concerts are at? (I can recognize some of the recordings but not all) without this thought it\'d be a very nice disc.','2011-10-16 19:46:49',1,0),(500,391,'JB','Early show','2011-10-16 20:08:19',0,0),(501,49,'JB','Late show','2011-10-16 20:08:35',0,0),(502,48,'JB','Set 2','2011-10-16 20:08:52',0,0),(503,392,'JB','At Entpe','2011-10-16 20:16:46',0,0),(504,393,'Bob','With the Modern Lovers. The first track here doesn\'t sound quite right, but the sound on rest of the recording is pretty good.','2011-10-16 20:21:15',1,0),(505,56,'Bob','A very clear recording','2011-10-16 20:23:49',1,0),(506,394,'Bob','With (among others) Carla Brownlee, Curly Keranan, Ellie Marshall, and Jamie Hawkins (?)','2011-10-16 20:31:32',1,0),(507,399,'Bob','Personal highlights are \'I\'m a Jerk\' and a really nice and long \'Affection\'.Deservedly Excellent.','2011-10-16 20:45:20',1,0),(508,84,'JB','Soundboard','2011-10-16 21:07:58',0,0),(509,403,'Bob','A radio broadcast, it probably would have been a great show, but it\'s a bit spoilt by the radio announcers cutting into the show endlessly between songs to remind you that  you\'re listening to \'Jonathan Richman and the Modern Lovers\', by the end of the show you\'ve probably heard this 20 times. They also, near the end, start to overlap their conversation well into the start of some songs. (I\'ve now got hold of a very clear and edited copy of this show, without all the announcers \'babble\', but there\'s a couple of track missing too).','2011-10-17 21:27:07',1,0),(510,405,'Bob','Jonathan breaks a string mid set and then spends the best part of the next 10 minutes taking time out telling jokes, the jokes are awful but the delivery\'s great  - Our kids really like the frog joke!','2011-10-18 21:29:47',1,0),(511,405,'JB','Late show','2011-10-18 21:29:55',0,0),(512,404,'Bob','A very low key and relaxed performance with some great guitar playing, particularly on \'That Summer Feeling\' and \'Everything\'s got to be right\'.','2011-10-18 21:30:25',1,0),(513,404,'JB','Early show','2011-10-18 21:30:57',0,0),(514,402,'Bob','With Brennan Totten ','2011-10-18 22:10:22',1,0),(515,408,'Bob','With Brennan Totten and Johnny Avila.','2011-10-18 22:30:45',1,0),(516,408,'JB','includes an intro','2011-10-18 22:30:57',0,0),(517,409,'Bob','Radio interview about 15 minutes long','2011-10-18 22:32:27',1,0),(518,410,'Bob','Interview by \'Big Jim Hunsicker\', with Jonathan and Brennan Totten. From an intended cable TV show that was never aired , the video of which has since deteriorated, this is the audio recording of the programme. About thirty minutes long. (On the same CD as 14th March 2008).Jonathan does a few songs between questions','2011-10-18 22:46:08',1,0),(519,410,'JB','&quot;I\'m a Little Dinosaur&quot; is a few lines only','2011-10-18 22:46:36',0,0),(520,413,'Bob','A short recording broadcast by the BBC on either the John Peel or Andy Kershaw Show, at about 12 minutes long','2011-10-19 11:06:19',1,0),(521,414,'Bob','Good audience recording of a solo show.','2011-10-19 11:12:27',1,0),(522,130,'JB','Soundboard','2011-10-19 11:15:15',0,0),(523,415,'Bob','A squirmingly bad interviewer: with some of the daftest questions that I\'ve yet heard asked, Jonathan does though give an excellent on air performance. About 10 minutes long','2011-10-19 12:05:11',1,0),(524,416,'Bob','A much better interview today, he\'s getting on really well with the shows presenter and is much more talkative than he was at the VARA interview yesterday. Jonathan also performs a few songs live in the studio too. About 30 minutes long','2011-10-19 12:06:47',1,0),(525,418,'JB','Recorded in September 1977','2011-10-19 15:04:45',0,0),(526,420,'Bob','Good quality solo show, something like  45 minutes long. ','2011-10-19 15:52:51',1,0),(527,420,'JB','&quot;Just For Fun&quot; is cut','2011-10-19 15:53:05',0,0),(528,154,'JB','In London, Ontario','2011-10-19 16:13:31',0,0),(529,421,'Bob','The presenter asks people to phone in with their questions to be put to Jonathan, which accordi