ut 15 minutes long.','2011-10-22 09:47:01',1,0),(555,442,'Bob','A radio interview completely in Spanish, something like 30 minutes long - including three songs performed live in the studio...','2011-10-22 09:48:51',1,0),(556,443,'Bob','Great recording made by P3 Live (Swedish Radio)','2011-10-22 09:53:51',1,1),(557,444,'Bob','A good show this one, Jonathan\'s quite talkative and speaking mainly in Spanish throughout the evening.','2011-10-22 12:12:33',1,0),(558,445,'Bob','Very short interview, only 4 minutes long','2011-10-22 12:17:56',1,0),(559,291,'JB','Part of this show was also broadcast on Madrid\'s Radio 3','2011-10-22 12:30:10',0,0),(560,447,'Bob','Pretty chaotic (and fun) show with two guest artists singing and playing guitars: Kiko Veneno and Muchachito Bombo Infierno. The show had three sets. ','2011-10-22 12:35:58',1,0),(561,447,'JB','Set two (South American Folk Song-No More Gasoline) is with Kiko Venero and Muchachito','2011-10-22 12:36:43',0,0),(562,448,'Bob','Radio recording of Jonathan and Tommy performing live for \'Los Conciertos de Radio 3\' (RNE 3), which was aired on the 4th of June 2007. ','2011-10-22 12:42:19',1,0),(563,449,'Bob','With Jonathan and Tommy','2011-10-22 12:48:44',1,0),(564,450,'Bob','45 minute interview broadcast on RNE3 (Radio Nacional de Espa&ntilde;a 3) just before the start of Jonathan and Tommy\'s latest European tour. The conversation is mainly in Spanish and the following few songs performed live in the studio.','2011-10-22 12:51:26',1,0),(565,451,'Bob','A short radio interview with one song performed on air','2011-10-22 12:52:25',1,0),(566,307,'JB','The recording stop\'s at &quot;You Can Have a CellPhone...&quot;','2011-10-22 12:53:33',0,0),(567,454,'JB','&quot;Si el Sexo hay que Planificar&quot; is more of an improvisation with a couple of sentences in Spanish','2011-10-22 14:01:08',0,0),(568,454,'JB','&quot;Affection&quot; is the encore','2011-10-22 14:01:30',0,0),(569,455,'JB','&quot;Celestial&quot; is in Spanish and E