5,'Jerry','This album seems to get mediocre reviews but I\'ve always loved it.','2011-10-28 11:46:51',0,0),(586,331,'Jerry','The very first JR album I bought. I ordered this LP through the mail around 1976-1977.','2011-10-28 11:58:33',0,0),(587,341,'Jerry','This album has grown on me over the years.','2011-10-28 11:59:44',0,0),(588,326,'Jerry','I didn\'t know what to expect when I heard that JR was doing a country album. But in the end it\'s just another great JR album.','2011-10-28 12:01:54',0,0),(589,338,'Jerry','Hard to believe that this album is now 20 years old! One of my favorites. Really solid album.','2011-10-28 12:06:27',0,0),(590,347,'Jerry','O Moon has grown on me but I\'m still having a hard time connecting with it. Not a bad album but JR seems like he\'s in a holding pattern with the last few releases. None of them are bad but the last few albums seem a bit to similar to each other.','2011-10-28 12:09:54',0,0),(591,335,'JB','Agreed! It just has a special feel that\'s even different from other albums. &quot;This Love of Mine&quot; and &quot;Just About 17&quot; are just pure magic','2011-10-28 12:31:24',0,0),(592,345,'Jerry','I think this is JR\'s best album since I\'m So Confused.','2011-10-28 12:51:46',0,0),(593,332,'Jerry','This album had me scratching my head when I first heard it. This album came out right after The Modern Lovers and it was like night and day. But this album was the direction JR would take from then on.','2011-10-28 13:13:07',0,0),(594,337,'Jerry','My favorites from this album are Closer and Everyday Clothes.','2011-10-28 17:05:56',0,0),(595,336,'Jerry','Harpo is my favorite. No real clunkers on this album.','2011-10-28 17:08:30',0,0),(596,344,'Jerry','I grin from ear to ear each time I hear The World Is Showing It\'s Hand.','2011-10-28 17:10:01',0,0),(597,334,'Jerry','Not a weak track here. 14 solid songs. One of his best easily.','2011-10-28 17:11:50',0,0),(598,343,'Jerry','I totally agree JB with your opinion below.','2011-10-28 1