Jerry','Shirin and Fahrad gets me a litle choked up when I hear it.','2011-10-28 18:02:04',0,0),(613,216,'DMDCAF','Great site. Thanks so much for this resource. Question on this recording date: Has anyone verified it as 1999? It seems very unlikely Jonathan played these songs after so long without playing them: Gail Loves Me; Closer; The Neighbors--to name a few. paz y amor, DMD dmdother@gmail.com','2011-10-29 00:18:24',0,0),(614,216,'JB','Good point DMDCAF, this show\'s setlist looks like it\'s more of a 1995 show than a 1999 show. I don\'t have the show to further verify...maybe someone could shed more light here?','2011-10-29 15:43:26',0,0),(615,337,'Jerry','I love the sound of Jonathan\'s guitar on this album.','2011-10-30 21:02:05',0,0),(616,335,'Jerry','Just About 17 is in my top ten JR songs of all time.','2011-10-30 21:03:22',0,0),(617,345,'Jerry','My mother is in a nursing home so the song As My Mother Lay Lying has special meaning for me.','2011-10-30 21:06:06',0,0),(618,323,'Jerry','I love the instrumental break in Affection.','2011-10-30 21:06:55',0,0),(619,326,'Jerry','This may be JR\'s best sounding cd along with I\'m So Confused. Both are very well produced.','2011-10-30 21:08:44',0,0),(620,326,'JB','Those Nashville musicians are top notch.This is the one album where I actually think that the re-makes of his songs don\'t spoil the album. The version of &quot;I Must Be King&quot; here sounds more fresh than the &quot;Jonathan Sings\'s&quot; version','2011-10-31 08:33:09',0,0),(621,337,'JB','Even simple songs like Sleepwalk will haunt on this album. To get this album you must enter a specific mood','2011-10-31 08:33:56',0,0),(622,334,'JB','After years of deliberating with myself...this one always ends up being my favorite JR album. Favorite song: &quot;Now Is Better Than Before&quot;','2011-10-31 08:35:19',0,0),(623,334,'JB','SKIPAfter years of deliberating with myself...this one always ends up being my favorite JR album. Favorite song: &quot;Now Is Better Than Before&quot;','2011-10-31 08:38:11',0,0),(624,334,'JB','SKIPAfter years of deliberating with myself...this one always ends up being my favorite JR album. Favorite song: &quot;Now Is Better Than Before&quot;','2011-10-31 08:38:29',0,0),(625,337,'JB','SKIPEven simple songs like Sleepwalk will haunt on this album. To get this album you must enter a specific mood','2011-10-31 09:53:20',0,0),(626,282,'Chris','Thumbs up!','2011-10-31 11:48:10',0,0),(627,328,'Jerry','On I Can\'t Find My Best Friend I love the way Jonathan says demanding all my POWER.','2011-10-31 18:18:48',0,0),(628,328,'JB','It sounds like &quot;Powahh&quot;','2011-10-31 20:22:17',0,0),(629,328,'Jerry','You\'re right it does. I just like the emphasis he puts on Power or Powahh.','2011-10-31 21:18:34',0,0),(630,328,'JB','Yeah, it\'s like he gives everything in his soul when he says that. I guess this song is about his wife because this is right after his divorce. With the dozens and dozens of songs already devoted to her it\'s obvious that every word of this song is from the soul. Gotta love it','2011-11-01 07:52:45',0,0),(631,321,'Jerry','Listening to Jonathan Sings right now. Depending on your speakers this album sounds so good on a decent system. Especially his vocals.','2011-11-01 17:57:19',0,0),(632,321,'JB','It\'s funny because I agree with you Jerry...but JR himself would disagree!','2011-11-02 08:05:06',0,0),(633,462,'JB','He also appeared on Tulane University Radio WTUL-FM on this date','2011-11-02 18:24:28',0,1),(634,464,'JB','An FM &quot;TUL Box&quot; broadcast solo set. The show was opened by &quot;The Iguanas&quot;. This is missing about 4 songs between &quot;California Dance Party&quot; and &quot;Dancin\' Late At Night&quot;','2011-11-02 18:32:35',0,0),(635,465,'JB','Intermission music is Valerie Massimi','2011-11-02 18:35:59',0,0),(636,465,'JB','&quot;She Cracked&quot; is played in the Monologue About Bermuda','2011-11-02 18:36:23',0,0),(637,461,'JB','This is a solo show','2011-11-0