INSERT INTO `songcomment` VALUES (10,715,'JB','Post about this song: http://jojofiles.blogspot.com/2008/06/stupenda-e-misera-citt.html','2011-10-12 18:35:49',0,0),(11,27,'Jerry','One of my all time favorite JR songs.','2011-10-28 11:19:12',0,0),(12,271,'Jerry','The very first JR song I ever heard. I heard Hospital on the radio around 1976 or so. That got me hooked for life.','2011-10-28 11:21:15',0,0),(13,181,'Jerry','A quintessential JR song!','2011-10-28 11:22:52',0,0),(14,58,'Jerry','Unlike any other song JR has written.Incredibly moving.','2011-10-28 11:24:20',0,0),(15,523,'Jerry','New Teller. In my top 10 JR songs.','2011-10-28 12:38:52',0,0),(16,130,'Jerry','I love this song. It\'s so Jonathan.','2011-10-28 12:40:47',0,0),(17,846,'Jerry','She\'s not so scary she\'s got all of my records! ','2011-10-28 12:45:23',0,0),(18,846,'JB','The term &quot;Vampire Girl&quot; has entered into my natural dialect because of this song','2011-10-28 13:00:05',0,0),(19,846,'JB','The term &quot;Vampire Girl&quot; has entered into my natural dialect because of this song','2011-10-28 13:03:00',0,0),(20,749,'Jerry','Crappy sugar lemonade!','2011-10-28 13:16:43',0,0),(21,921,'DMDCAF','There were many shows I was at where Jonathan at least did some of CLOSER as CERCA in espanol! Definitely my favorite song of his in Spanish!','2011-10-29 00:20:56',0,0),(22,921,'JB','I love when he goes &quot;mas y mas y mas y mas y mas y mas&quot;!','2011-10-29 15:44:12',0,0),(23,345,'Jerry','My favorite song on this album.','2011-10-30 20:59:49',0,0),(24,865,'Jerry','Magical','2011-10-30 21:00:31',0,0),(25,126,'Jerry','Great short guitar solo on this song.','2011-10-31 18:20:10',0,0),(26,705,'Jerry','The lame must be shaken up. Great line.','2011-10-31 18:21:06',0,0),(27,126,'JB','How is JR able to point out things that rarely get pointed out in such a lucid way?','2011-11-01 07:53:20',0,0),(28,1011,'JB','What could be said about this song? For me it\'s the epitome of Jonathan Richman','2011-11-01 08:09:09',0,1),(29,1011,'JB','JojoBlog post for the song with a live performance: http://jojofiles.blogspot.com/2011/11/door-to-bohemia.html','2011-11-01 08:09:31',0,0),(30,1011,'JB','SKIPJojoBlog post for the song with a live performance: http://jojofiles.blogspot.com/2011/11/door-to-bohemia.html','2011-11-01 09:12:34',0,0),(31,1011,'Jerry','I hope that Bohemia shows up on the next album but aren\'t there quite a few excellent JR songs that never appeared on any of his albums?','2011-11-01 16:47:43',0,0),(32,1011,'JB','Some unreleased recent songs: Mr. Sorrow, Bohemia, Her Love Is From Somewhere Else, Hard Time Saying Goodbye, Italian Party Song, Hebrew Party Song (barbeque), Keith Richards. There\'s even a few that I\'m missing','2011-11-01 22:47:44',0,0),(33,1011,'JR Fan 1','SKIPi meant to down vote JB\'s comment not the song','2011-11-02 00:19:39',0,0),(34,22,'JR Fan 1','SKIPhe should do a duet with Celine Dion','2011-11-02 00:23:52',0,0),(35,32,'JR Fan 1','This song gives me good chills!','2011-11-02 00:24:29',0,0),(36,39,'JR Fan 1','SKIPJR is the man!  He lives near my family.  I want to wear his socks','2011-11-02 00:26:05',0,0),(37,94,'JB','This song was written in the studio during the recording of &quot;Modern Lover\'s 88&quot;','2011-11-05 09:09:10',0,0),(38,42,'Jerry','Kind of a strange JR song.','2011-11-08 20:10:05',0,0),(39,851,'Jerry','I love it when JR writes songs about real people. Velvet Underground,Pablo Picasso,Walter Johnson, etc.','2011-11-08 20:12:29',0,0),(40,926,'Jerry','I\'d like to put together a cd of JR instrumentals.','2011-11-08 20:15:18',0,0),(41,926,'JB','Can you believe that there is not a single known live version of this song?','2011-11-09 14:56:19',0,0),(42,42,'JB','It\'s weird when JR get\'s political...but it happens so rarely that you know it\'s a subject that means a lot to him','2011-11-09 14:57:08',0,0),(43,42,'JB','SKIPIt\'s weird when JR get\'s political...but it happens so rarely that you know it\'s a subject that means a lot to him','2011-11-09 17:01:18',0,0),(44,42,'Chris F. ','I like how the albums appear in bold and increased font size...','2011-11-09 18:25:11',0,1),(45,42,'jb','SKIPit\'s weird when jr get\'s political...but it happens so rarely that you know it\'s a subject that means a lot to him','2011-11-09 19:58:47',0,0),(46,733,'Jerry','I love this song from the dvd.','2011-11-09 20:22:30',0,0),(47,110,'JB','The single version of this song: http://www.youtube.com/watch?v=FMmSH-628jI','2011-11-24 21:58:34',0,0),(48,883,'JB','This could be one of most rare fully-formed Jonathan Richman songs. As tantalizing as \"A Little Boy In My Heart\" and \"I Don\'t Want No More Nuclear Power\"','2011-11-24 23:00:55',0,0),(49,178,'JB','Jonathan performing this in someone\'s backyard!: http://vimeo.com/1385299','2011-11-24 23:48:28',0,0),(50,63,'JB','Also known as \"Don\'t Change For Me\"','2011-11-25 01:25:04',0,0),(51,513,'JB','Also known as &quot;I Can\'t Stand To See People With Their Feeling\'s Hurt&quot;','2011-11-25 01:26:28',0,0),(52,55,'JB','Also known as &quot;Better&quot;','2011-11-25 01:27:16',0,0),(53,286,'Jerry','His funniest song? Even though it\'s not really a song.','2011-11-28 17:29:51',0,0),(54,336,'Jerry','What does God Pan mean?','2011-11-28 17:31:19',0,0),(55,336,'JB','SKIPI believe he is referring to the Greek god \"Pan\", the god of nature-like things: http://en.wikipedia.org/wiki/Pan_(god).So, maybe the grammar should be: \"I\'m Your God, Pan\". He keeps his Pan-Pipe ready for Pan-Melodies! He lives in the woods...not much to steal...but those colors well, those colors are real (natural)','2011-11-29 07:31:05',0,0),(56,286,'JB','This song threw me off at first but now I think it\'s hilarious','2011-11-29 07:33:03',0,0),(57,336,'JB','SKIPI believe he is referring to the Roman god &quot;Pan&quot;, the god of nature-like things: http://en.wikipedia.org/wiki/Pan_(god).So, maybe the grammar should be: &quot;I\'m Your God, Pan&quot;. He keeps his Pan-Pipe ready for Pan-Melodies! He lives in the woods...not much to steal...but those colors well, those colors are real (natural)','2011-11-29 07:34:36',0,0),(58,336,'JB','I believe he is referring to the Roman god &quot;Pan&quot;, the god of nature-like things: http://en.wikipedia.org/wiki/Pan_(god).So, maybe the grammar should be: &quot;I\'m Your God, Pan&quot;. He keeps his Pan-Pipe ready for Pan-Melodies! He lives in the woods...not much to steal...but those colors well, those colors are real (natural)','2011-11-29 07:35:43',0,1),(59,493,'Jerry','A strange JR song. Dark and almost evil sounding at times. Unless I\'m missing the point of the song entirely. It wouldn\'t be the first time!','2011-11-29 17:30:29',0,0),(60,493,'JB','Yeah, this one and The Neighbors are both dark. Still not completely sure if I really get them...and I\'ve heard them both countless times!','2011-11-30 07:16:05',0,0),(61,141,'Jerry','Strange title for a JR song.','2012-01-17 17:06:53',0,1),(62,141,'JB','SKIPI\'ve never heard this song. I wonder if it\'s a full song or some sort of poem','2012-01-20 11:19:14',0,0),(63,141,'JB','I\'ve never heard this song. I wonder if it\'s a full song or some sort of poem','2012-01-20 12:24:51',0,0),(64,1025,'JB','Originally by the Edsels','2012-02-10 06:57:37',0,0),(65,1025,'JB','Originally by the Edsels','2012-02-10 07:01:18',0,0),(66,671,'JB','A great lost song','2012-02-11 07:17:31',0,0),(67,967,'JB','Does anyone know if this is a cover version?','2012-02-13 12:18:17',0,0),(68,131,'Pol Dodu','The proper title for this one is &quot;At my front door&quot;, although on stage in 1979 in Paris for the Chorus show, Jonathan himself first introduced it as &quot;Crazy little Mama&quot;, before correcting himself. It\'s a cover of the biggest hit by The El Dorados, from 1955...','2012-05-18 12:35:59',0,0);
